import React from 'react';
import { Link } from 'react-router-dom';

const NavigationPage = () => {
  return (
    <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', marginTop: '50px' }}>
      <h1>Navigacijska Stranica</h1>
      <Link to="/"><button>Glavni Izbornik</button></Link>
      <Link to="/login"><button>Login Page</button></Link>
      <Link to="/popis-bodova"><button>Popis Bodova</button></Link>
      <Link to="/popis-divljaci"><button>Popis Divljači</button></Link>
      <Link to="/popis-lova"><button>Popis Lova</button></Link>
      <Link to="/popis-lovaca"><button>Popis Lovaca</button></Link>
      <Link to="/popis-ostrijela"><button>Popis Ostrjela</button></Link>
      <Link to="/raspored-aktivnosti"><button>Raspored Aktivnosti</button></Link>
      <Link to="/unos-bodova"><button>Unos Bodova</button></Link>
      <Link to="/unos-divljaci"><button>Unos Divljači</button></Link>
      <Link to="/unos-lovca"><button>Unos Lovca</button></Link>
      <Link to="/unos-ostrijela"><button>Unos Ostrjela</button></Link>
      <Link to="/unos-rasporeda"><button>Unos Rasporeda</button></Link>
    </div>
  );
};

export default NavigationPage;
